import 'dart:collection';
import 'package:flutter/material.dart';
import '../utils/user_preferences.dart';
import '../models/chat_message.dart';

class ChatData extends ChangeNotifier {
  final List<ChatMessage> _chatMessage = [
    // Dummy data
    ChatMessage(
      userProfile: UserPreferences(),
      messageContent:
          'data:image/jpeg;base64,',
      isMe: false,
      isMessage: false,
    ),
    ChatMessage(
      userProfile: UserPreferences(),
      messageContent:
          'data:image/jpeg;base64,',
      isMe: false,
      isMessage: false,
    ),
    ChatMessage(
      userProfile: UserPreferences(),
      messageContent:
          'data:image/jpeg;base64,',
      isMe: true,
      isMessage: false,
    ),
    ChatMessage(
      userProfile: UserPreferences(),
      messageContent:
          'data:image/jpeg;base64,',
      isMe: false,
      isMessage: false,
    ),
    ChatMessage(
      userProfile: UserPreferences(),
      messageContent:
          'data:image/jpeg;base64,',
      isMe: false,
      isMessage: false,
    ),
  ];

  UnmodifiableListView<ChatMessage> get chatMessage =>
      UnmodifiableListView(_chatMessage);
  void addChatMessage(UserPreferences userProfile, String messageContent,
      bool isMe, bool isMessage) {
    _chatMessage.add(ChatMessage(
        userProfile: userProfile,
        messageContent: messageContent,
        isMe: isMe,
        isMessage: isMessage));
    notifyListeners();
  }

  int get length => _chatMessage.length;
}
